// Helper function to find opening moves
static inline const OpeningEntry* find_opening_move(uint32_t hash) {
    for (int i = 0; i < OPENING_BOOK_SIZE; i++) {
        if (opening_book[i].hash == hash) {
            return &opening_book[i];
        }
    }
    return NULL;
}

